import React from 'react';
import PIC3 from './cleansinOil.jpg';
import PIC4 from './lemon.jpg';
import PIC5 from './cucumber.jpg';
import PIC6 from './almondOil.jpg';
import './secTwo.style.css';

const SecTwo = () => (
    <div className='secTwo-container'>
        <div className='secTwo-col1'>
            <img src={PIC3} alt='cleansingOil' className='secTwo-element1' />

            <img src={PIC4} alt='lemon' className='secTwo-element2-1' />
            <div className='secTwo-element2-text'>
                <h3>TREATMENT</h3>
                <p>We dedicate to innovating formulas that works for different needs.</p>
            </div>

        </div>
        <div className='secTwo-col2'>
            <div className='secTwo-element3-text'>
                <h3>LET US CHANGE YOUR SKIN</h3>
                <p>Discover healthy-looking skin with formulas powered by nature and science.</p>
            </div>
            <img src={PIC6} alt='almondOil' className='secTwo-element3' />
        </div>
    </div>
);

export default SecTwo;
